function App() {
  return (

      <div className="App">
        <Routes>
        <Route path="/" element={<Home />} />
          {/* Define a route for the chatbox with username and roomname params */}
          <Route path="/chat/:roomname/:username" element={<Chatbox />} />

        </Routes>
      </div>

  );
}

export default App;
